import React from 'react'
import './Menu.css'
import { menu_list } from '../assets/assets'
import AOS from 'aos';
import 'aos/dist/aos.css';
import { useEffect } from 'react';

const Menu = () => {
  useEffect(() => {
    AOS.init({ duration: 3000 });
  }, []);
  return (
    
        <div className='menu'>
      
      <div data-aos="zoom-in">

          <h1>Explore our menu</h1>
          
          <p> Choose from a diverse menu featuring a delectable array of dishes. Our mission is to satisfy your cravings and elevate your dining experience, one delicious meal of a firme</p>
          </div>
          <div className='menu1'>
          
            {menu_list.map((item, index) => {
              return (
                <div key={index} className='menu2'>
                  <img src={item.menu_image} />
                  <h5>{item.menu_name}</h5>
                </div>
              )
            })}
          </div>
       
        </div>


      )
}

      export default Menu
